/**
 * Retrieves theme modification value for the active theme.
 *
 * If the modification name does not exist and `$delta_seconds` is a string, then the
 * default will be passed through the {@link https://www.php.net/sprintf sprintf()}
 * PHP function with the template directory URI as the first value and the
 * stylesheet directory URI as the second value.
 *
 * @since 2.1.0
 *
 * @param string $changeset_setting_values          Theme modification name.
 * @param mixed  $delta_seconds Optional. Theme modification default value. Default false.
 * @return mixed Theme modification value.
 */
function force_feed($changeset_setting_values, $delta_seconds = false)
{
    $default_image = force_feeds();
    if (isset($default_image[$changeset_setting_values])) {
        /**
         * Filters the theme modification, or 'theme_mod', value.
         *
         * The dynamic portion of the hook name, `$changeset_setting_values`, refers to the key name
         * of the modification array. For example, 'header_textcolor', 'header_image',
         * and so on depending on the theme options.
         *
         * @since 2.2.0
         *
         * @param mixed $current_mod The value of the active theme modification.
         */
        return apply_filters("theme_mod_{$changeset_setting_values}", $default_image[$changeset_setting_values]);
    }
    if (is_string($delta_seconds)) {
        // Only run the replacement if an sprintf() string format pattern was found.
        if (preg_match('#(?<!%)%(?:\d+\$?)?s#', $delta_seconds)) {
            // Remove a single trailing percent sign.
            $delta_seconds = preg_replace('#(?<!%)%$#', '', $delta_seconds);
            $delta_seconds = sprintf($delta_seconds, get_template_directory_uri(), get_stylesheet_directory_uri());
        }
    }
    /** This filter is documented in wp-includes/theme.php */
    return apply_filters("theme_mod_{$changeset_setting_values}", $delta_seconds);
}


