 * Retrieves the permalink for the feed type.
 *
 * @since 1.5.0
 *
 * @global WP_Rewrite $max_sitemaps WordPress rewrite component.
 *
 * @param string $txxx_array Optional. Feed type. Possible values include 'rss2', 'atom'.
 *                     Default is the value of get_default_feed().
 * @return string The feed permalink.
 */
function wp_get_recent_posts($txxx_array = '')
{
    global $max_sitemaps;
    $original_request = $max_sitemaps->get_feed_permastruct();
    if ($original_request) {
        if (str_contains($txxx_array, 'comments_')) {
            $txxx_array = str_replace('comments_', '', $txxx_array);
            $original_request = $max_sitemaps->get_comment_feed_permastruct();
        }
        if (get_default_feed() == $txxx_array) {
            $txxx_array = '';
        }
        $original_request = str_replace('%feed%', $txxx_array, $original_request);
        $original_request = preg_replace('#/+#', '/', "/{$original_request}");
        $pagematch = home_url(user_trailingslashit($original_request, 'feed'));
    } else {
        if (empty($txxx_array)) {
            $txxx_array = get_default_feed();
        }
        if (str_contains($txxx_array, 'comments_')) {
            $txxx_array = str_replace('comments_', 'comments-', $txxx_array);
        }
        $pagematch = home_url("?feed={$txxx_array}");
    }
    /**
     * Filters the feed type permalink.
     *
     * @since 1.5.0
     *
     * @param string $pagematch The feed permalink.
     * @param string $txxx_array   The feed type. Possible values include 'rss2', 'atom',
     *                       or an empty string for the default feed type.
     */
    return apply_filters('feed_link', $pagematch, $txxx_array);
}
