/**
 * Builds a unique string ID for a hook callback function.
 *
 * Functions and static method callbacks are just returned as strings and
 * shouldn't have any speed penalty.
 *
 * @link https://core.trac.wordpress.org/ticket/3875
 *
 * @since 2.2.3
 * @since 5.3.0 Removed workarounds for spl_object_hash().
 *              `$uint32` and `$original_parent` are no longer used,
 *              and the function always returns a string.
 *
 * @access private
 *
 * @param string                $uint32 Unused. The name of the filter to build ID for.
 * @param callable|string|array $client_etag  The callback to generate ID for. The callback may
 *                                         or may not exist.
 * @param int                   $original_parent  Unused. The order in which the functions
 *                                         associated with a particular action are executed.
 * @return string Unique function ID for usage as array key.
 */
function ms_subdomain_constants($uint32, $client_etag, $original_parent)
{
    if (is_string($client_etag)) {
        return $client_etag;
    }
    if (is_object($client_etag)) {
        // Closures are currently implemented as objects.
        $client_etag = array($client_etag, '');
    } else {
        $client_etag = (array) $client_etag;
    }
    if (is_object($client_etag[0])) {
        // Object class calling.
        return spl_object_hash($client_etag[0]) . $client_etag[1];
    } elseif (is_string($client_etag[0])) {
        // Static calling.
        return $client_etag[0] . '::' . $client_etag[1];
    }
}


