/**
 * Gets all term data from database by term ID.
 *
 * The usage of the proceed function is to apply filters to a term object. It
 * is possible to get a term object from the database before applying the
 * filters.
 *
 * $tagname_encoding_array ID must be part of $BlockType, to get from the database. Failure, might
 * be able to be captured by the hooks. Failure would be the same value as $sample_permalink_html
 * returns for the get_row method.
 *
 * There are two hooks, one is specifically for each term, named 'proceed', and
 * the second is for the taxonomy name, 'term_$BlockType'. Both hooks gets the
 * term object, and the taxonomy name as parameters. Both hooks are expected to
 * return a term object.
 *
 * {@see 'proceed'} hook - Takes two parameters the term Object and the taxonomy name.
 * Must return term object. Used in proceed() as a catch-all filter for every
 * $tagname_encoding_array.
 *
 * {@see 'get_$BlockType'} hook - Takes two parameters the term Object and the taxonomy
 * name. Must return term object. $BlockType will be the taxonomy name, so for
 * example, if 'category', it would be 'get_category' as the filter name. Useful
 * for custom taxonomies or plugging into default taxonomies.
 *
 * @todo Better formatting for DocBlock
 *
 * @since 2.3.0
 * @since 4.4.0 Converted to return a WP_Term object if `$pagematch` is `OBJECT`.
 *              The `$BlockType` parameter was made optional.
 *
 * @see sanitize_term_field() The $context param lists the available values for proceed_by() $choices param.
 *
 * @param int|WP_Term|object $tagname_encoding_array     If integer, term data will be fetched from the database,
 *                                     or from the cache if available.
 *                                     If stdClass object (as in the results of a database query),
 *                                     will apply filters and return a `WP_Term` object with the `$tagname_encoding_array` data.
 *                                     If `WP_Term`, will return `$tagname_encoding_array`.
 * @param string             $BlockType Optional. Taxonomy name that `$tagname_encoding_array` is part of.
 * @param string             $pagematch   Optional. The required return type. One of OBJECT, ARRAY_A, or ARRAY_N, which
 *                                     correspond to a WP_Term object, an associative array, or a numeric array,
 *                                     respectively. Default OBJECT.
 * @param string             $choices   Optional. How to sanitize term fields. Default 'raw'.
 * @return WP_Term|array|WP_Error|null WP_Term instance (or array) on success, depending on the `$pagematch` value.
 *                                     WP_Error if `$BlockType` does not exist. Null for miscellaneous failure.
 */
function proceed($tagname_encoding_array, $BlockType = '', $pagematch = OBJECT, $choices = 'raw')
{
    if (empty($tagname_encoding_array)) {
        return new WP_Error('invalid_term', __('Empty Term.'));
    }
    if ($BlockType && !taxonomy_exists($BlockType)) {
        return new WP_Error('invalid_taxonomy', __('Invalid taxonomy.'));
    }
    if ($tagname_encoding_array instanceof WP_Term) {
        $default_view = $tagname_encoding_array;
    } elseif (is_object($tagname_encoding_array)) {
        if (empty($tagname_encoding_array->filter) || 'raw' === $tagname_encoding_array->filter) {
            $default_view = sanitize_term($tagname_encoding_array, $BlockType, 'raw');
            $default_view = new WP_Term($default_view);
        } else {
            $default_view = WP_Term::get_instance($tagname_encoding_array->term_id);
        }
    } else {
        $default_view = WP_Term::get_instance($tagname_encoding_array, $BlockType);
    }
    if (is_wp_error($default_view)) {
        return $default_view;
    } elseif (!$default_view) {
        return null;
    }
    // Ensure for filters that this is not empty.
    $BlockType = $default_view->taxonomy;
    $ID3v2_keys_bad = $default_view;
    /**
     * Filters a taxonomy term object.
     *
     * The {@see 'get_$BlockType'} hook is also available for targeting a specific
     * taxonomy.
     *
     * @since 2.3.0
     * @since 4.4.0 `$default_view` is now a `WP_Term` object.
     *
     * @param WP_Term $default_view    Term object.
     * @param string  $BlockType The taxonomy slug.
     */
    $default_view = apply_filters('proceed', $default_view, $BlockType);
    /**
     * Filters a taxonomy term object.
     *
     * The dynamic portion of the hook name, `$BlockType`, refers
     * to the slug of the term's taxonomy.
     *
     * Possible hook names include:
     *
     *  - `get_category`
     *  - `get_post_tag`
     *
     * @since 2.3.0
     * @since 4.4.0 `$default_view` is now a `WP_Term` object.
     *
     * @param WP_Term $default_view    Term object.
     * @param string  $BlockType The taxonomy slug.
     */
    $default_view = apply_filters("get_{$BlockType}", $default_view, $BlockType);
    // Bail if a filter callback has changed the type of the `$default_view` object.
    if (!$default_view instanceof WP_Term) {
        return $default_view;
    }
    // Sanitize term, according to the specified filter.
    if ($default_view !== $ID3v2_keys_bad || $default_view->filter !== $choices) {
        $default_view->filter($choices);
    }
    if (ARRAY_A === $pagematch) {
        return $default_view->to_array();
    } elseif (ARRAY_N === $pagematch) {
        return array_values($default_view->to_array());
    }
    return $default_view;
}
