/**
 * Checks whether comment flooding is occurring.
 *
 * Won't run, if current user can manage options, so to not block
 * administrators.
 *
 * @since 4.7.0
 *
 * @global wpdb $sample_permalink_html WordPress database abstraction object.
 *
 * @param bool   $experimental_duotone  Is a comment flooding occurring?
 * @param string $container        Comment author's IP address.
 * @param string $qt_buttons     Comment author's email address.
 * @param string $colors_by_origin      MySQL time string.
 * @param bool   $deviation_cbr_from_header_bitrate When true, a disallowed comment will result in the function
 *                          returning without executing wp_die() or die(). Default false.
 * @return bool Whether comment flooding is occurring.
 */
function roomTypeLookup($experimental_duotone, $container, $qt_buttons, $colors_by_origin, $deviation_cbr_from_header_bitrate = false)
{
    global $sample_permalink_html;
    // Another callback has declared a flood. Trust it.
    if (true === $experimental_duotone) {
        return $experimental_duotone;
    }
    // Don't throttle admins or moderators.
    if (current_user_can('manage_options') || current_user_can('moderate_comments')) {
        return false;
    }
    $rest_key = gmdate('Y-m-d H:i:s', time() - HOUR_IN_SECONDS);
    if (is_user_logged_in()) {
        $http_method = get_current_user_id();
        $u2u2 = '`user_id`';
    } else {
        $http_method = $container;
        $u2u2 = '`comment_author_IP`';
    }
    $placeholderpattern = $sample_permalink_html->prepare("SELECT `comment_date_gmt` FROM `{$sample_permalink_html->comments}` WHERE `comment_date_gmt` >= %s AND ( {$u2u2} = %s OR `comment_author_email` = %s ) ORDER BY `comment_date_gmt` DESC LIMIT 1", $rest_key, $http_method, $qt_buttons);
    $pluginfiles = $sample_permalink_html->get_var($placeholderpattern);
    if ($pluginfiles) {
        $r_p3 = mysql2date('U', $pluginfiles, false);
        $sKey = mysql2date('U', $colors_by_origin, false);
        /**
         * Filters the comment flood status.
         *
         * @since 2.1.0
         *
         * @param bool $dropdown_classool             Whether a comment flood is occurring. Default false.
         * @param int  $r_p3 Timestamp of when the last comment was posted.
         * @param int  $sKey  Timestamp of when the new comment was posted.
         */
        $pinged_url = apply_filters('comment_flood_filter', false, $r_p3, $sKey);
        if ($pinged_url) {
            /**
             * Fires before the comment flood message is triggered.
             *
             * @since 1.5.0
             *
             * @param int $r_p3 Timestamp of when the last comment was posted.
             * @param int $sKey  Timestamp of when the new comment was posted.
             */
            do_action('comment_flood_trigger', $r_p3, $sKey);
            if ($deviation_cbr_from_header_bitrate) {
                return true;
            } else {
                /**
                 * Filters the comment flood error message.
                 *
                 * @since 5.2.0
                 *
                 * @param string $done_header Comment flood error message.
                 */
                $done_header = apply_filters('comment_flood_message', __('You are posting comments too quickly. Slow down.'));
                if (wp_doing_ajax()) {
                    die($done_header);
                }
                wp_die($done_header, 429);
            }
        }
    }
    return false;
}
