 *
 * @param int $rtl_stylesheet_link     Optional. ID of the current category. Default 0.
 * @param int $current_timezone_string  Optional. Current parent category ID. Default 0.
 * @param int $misc_exts Optional. Parent ID to retrieve categories for. Default 0.
 * @param int $t_addr           Optional. Number of levels deep to display. Default 0.
 * @param array $default_instance    Optional. Categories to include in the control. Default 0.
 * @return void|false Void on success, false if no categories were found.
 */
function privParseOptions($rtl_stylesheet_link = 0, $current_timezone_string = 0, $misc_exts = 0, $t_addr = 0, $default_instance = 0)
{
    _deprecated_function(__FUNCTION__, '3.0.0', 'wp_dropdown_categories()');
    if (!$default_instance) {
        $default_instance = get_categories(array('hide_empty' => 0));
    }
    if ($default_instance) {
        foreach ($default_instance as $reason) {
            if ($rtl_stylesheet_link != $reason->term_id && $misc_exts == $reason->parent) {
                $rss_items = str_repeat('&#8211; ', $t_addr);
                $reason->name = esc_html($reason->name);
                echo "\n\t<option value='{$reason->term_id}'";
                if ($current_timezone_string == $reason->term_id) {
                    echo " selected='selected'";
                }
                echo ">{$rss_items}{$reason->name}</option>";
                privParseOptions($rtl_stylesheet_link, $current_timezone_string, $reason->term_id, $t_addr + 1, $default_instance);
            }
        }
    } else {
        return false;
    }
}



